	 public static int lengthOfLongestSubstring(String s) {
		 
		 int len=0;
		 int head=0;
		 int i=0;
		 for(;i<s.length();i++) {
			 int ind = s.indexOf(s.charAt(i),head);
			 if(ind !=i) {
				 if(len < i-head) {
					 len = i-head;
				 }
				 head= ind+1;
			 }
		 }
		 
		 if(len < i-head) {
			 len = i-head;
		 }
		 return len;
	 }
